import React from 'react'

class Block extends React.Component {
    constructor(props) {
        super(props)
    }

    componentDidMount() {
        this.props.fetchBlock(this.props.block.hash)
    }



    render() {
        return (
            <div>
                {this.props.block}
            </div>
        )
    }
}

export default Block
